public static SpatialOperation get( String v ) {
  SpatialOperation op = registry.get( v );
  if( op == null ) {
    op = registry.get(v.toUpperCase(Locale.US));
  }
  if( op == null ) {
    throw new InvalidSpatialArgument("Unknown Operation: " + v );
  }
  return op;
}

